import React from 'react';
import './Fsc.css';

function Fsc() {
  return (
    <div className="fsc-container">
      <img src="" alt="FSC Certification" className="fsc-image fade-in" />
      <div className="fsc-details fade-in">
        <h2 className="fsc-title">FSC Certification</h2>
        <p className="fsc-description">
          Our FSC certification reflects our commitment to sustainable forestry practices. This certification ensures that our products come from responsibly managed forests that provide environmental, social, and economic benefits.
        </p>
      </div>
    </div>
  );
}

export default Fsc;
